<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>KeyGen Nebula</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
    <link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700&family=Space+Mono&display=swap" rel="stylesheet">
    <style>
        body {
            background: radial-gradient(circle at center, #0a0f1f 0%, #020409 100%);
            overflow-x: hidden;
            font-family: 'Orbitron', sans-serif;
            margin: 0;
        }
        @keyframes neonGlow {
            0%, 100% { box-shadow: 0 0 10px rgba(139, 92, 246, 0.6); }
            50% { box-shadow: 0 0 20px rgba(139, 92, 246, 0.9); }
        }
        @keyframes pulse {
            0% { transform: scale(1); }
            50% { transform: scale(1.1); }
            100% { transform: scale(1); }
        }
        @keyframes slideIn {
            from { transform: translateY(40px); opacity: 0; }
            to { transform: translateY(0); opacity: 1; }
        }
        @keyframes textGlow {
            0% { text-shadow: 0 0 4px rgba(236, 72, 153, 0.4); }
            50% { text-shadow: 0 0 12px rgba(236, 72, 153, 0.9); }
            100% { text-shadow: 0 0 4px rgba(236, 72, 153, 0.4); }
        }
        @keyframes trailGlow {
            0% { box-shadow: 0 0 4px rgba(139, 92, 246, 0.4); }
            50% { box-shadow: 0 0 12px rgba(139, 92, 246, 0.9); }
            100% { box-shadow: 0 0 4px rgba(139, 92, 246, 0.4); }
        }
        @keyframes particle {
            0% { transform: translateY(0) scale(1); opacity: 0.8; }
            100% { transform: translateY(-120vh) scale(0.3); opacity: 0; }
        }
        @keyframes characterWalk {
            0% { background-position: 0 0; }
            100% { background-position: -256px 0; }
        }
        @keyframes characterFloat {
            0% { transform: translateY(0); }
            50% { transform: translateY(-20px); }
            100% { transform: translateY(0); }
        }
        @keyframes spaceshipFly {
            0% { transform: translateX(0) translateY(0) rotate(0deg); }
            50% { transform: translateX(60px) translateY(-30px) rotate(8deg); }
            100% { transform: translateX(0) translateY(0) rotate(0deg); }
        }
        @keyframes beamPulse {
            0% { opacity: 0.3; transform: scaleY(1); }
            50% { opacity: 0.8; transform: scaleY(1.3); }
            100% { opacity: 0.3; transform: scaleY(1); }
        }
        @keyframes orbGlow {
            0% { box-shadow: 0 0 10px rgba(236, 72, 153, 0.5); }
            50% { box-shadow: 0 0 20px rgba(236, 72, 153, 0.9); }
            100% { box-shadow: 0 0 10px rgba(236, 72, 153, 0.5); }
        }
        @keyframes nebulaCloud {
            0% { transform: translateX(0); opacity: 0.2; }
            50% { transform: translateX(-50px); opacity: 0.5; }
            100% { transform: translateX(0); opacity: 0.2; }
        }
        @keyframes meteorTrail {
            0% { transform: translate(0, 0); opacity: 0.9; }
            100% { transform: translate(-90vw, 90vh); opacity: 0; }
        }
        .neon-glow { animation: neonGlow 1s infinite; }
        .pulse { animation: pulse 1.5s infinite; }
        .slide-in { animation: slideIn 1s ease-out; }
        .text-glow { animation: textGlow 1.2s infinite; }
        .gradient-bg { background: linear-gradient(135deg, #f472b6 0%, #f87171 100%); }
        .card-bg { 
            background: rgba(17, 24, 39, 0.9); 
            backdrop-filter: blur(20px); 
            border: 1px solid rgba(255, 255, 255, 0.2); 
        }
        .countdown { font-family: 'Space Mono', monospace; }
        .particle {
            position: absolute;
            width: 6px;
            height: 6px;
            background: radial-gradient(circle, rgba(236, 72, 153, 0.8), transparent);
            border-radius: 50%;
            animation: particle 2.5s linear infinite, trailGlow 0.4s infinite;
            pointer-events: none;
        }
        .stars, .meteors {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
        }
        .star {
            position: absolute;
            width: 2px;
            height: 2px;
            background: white;
            border-radius: 50%;
            animation: twinkle 1.5s infinite;
        }
        .meteor {
            position: absolute;
            width: 8px;
            height: 8px;
            background: radial-gradient(circle, #ff6b6b 0%, transparent 70%);
            border-radius: 50%;
            animation: meteorTrail 1.8s linear infinite, trailGlow 0.4s infinite;
            pointer-events: none;
        }
        @keyframes twinkle {
            0%, 100% { opacity: 0.5; }
            50% { opacity: 1; }
        }
        .key-info {
            transition: all 0.4s ease;
        }
        .key-info:hover {
            background: rgba(255, 255, 255, 0.15);
            transform: translateY(-4px);
            box-shadow: 0 8px 16px rgba(0, 0, 0, 0.4);
        }
        .character {
            position: absolute;
            width: 64px;
            height: 64px;
            background-size: 256px 64px;
            animation: characterWalk 0.5s steps(4) infinite, characterFloat 1.5s ease-in-out infinite;
            opacity: 0.4;
            pointer-events: none;
        }
        .spaceship {
            position: absolute;
            width: 70px;
            height: 70px;
            background-size: contain;
            background-repeat: no-repeat;
            animation: spaceshipFly 2.8s ease-in-out infinite;
            opacity: 0.6;
            pointer-events: none;
        }
        .beam {
            position: absolute;
            width: 3px;
            height: 120px;
            background: linear-gradient(to bottom, rgba(139, 92, 246, 0.8), transparent);
            animation: beamPulse 1.4s infinite;
            pointer-events: none;
        }
        .orb {
            position: absolute;
            width: 25px;
            height: 25px;
            background: radial-gradient(circle, #ec4899 0%, transparent 70%);
            border-radius: 50%;
            animation: orbGlow 0.9s infinite;
            pointer-events: none;
        }
        .nebula {
            position: absolute;
            width: 300px;
            height: 300px;
            background: radial-gradient(circle, rgba(168, 85, 247, 0.3), transparent 70%);
            animation: nebulaCloud 7s ease-in-out infinite;
            pointer-events: none;
        }
        .history-table {
            max-height: 180px;
            overflow-y: auto;
            scrollbar-width: thin;
            scrollbar-color: rgba(139, 92, 246, 0.4) transparent;
        }
        .history-table::-webkit-scrollbar {
            width: 5px;
        }
        .history-table::-webkit-scrollbar-track {
            background: transparent;
        }
        .history-table::-webkit-scrollbar-thumb {
            background: rgba(139, 92, 246, 0.4);
            border-radius: 3px;
        }
        .character-1 { background-image: url('https://opengameart.org/sites/default/files/hero_3.png'); }
        .character-2 { background-image: url('https://opengameart.org/sites/default/files/herochar_spritesheet.png'); }
        .spaceship-1 { background-image: url('https://opengameart.org/sites/default/files/spaceship_0.png'); }
        .spaceship-2 { background-image: url('https://opengameart.org/sites/default/files/spaceship_1.png'); }
        .spaceship-3 { background-image: url('https://opengameart.org/sites/default/files/spaceship_2.png'); }
        .spaceship-4 { background-image: url('https://opengameart.org/sites/default/files/spaceship_3.png'); }

        /* Mobile Optimizations */
        @media (max-width: 768px) {
            body {
                overflow-y: auto;
            }
            .card-bg {
                backdrop-filter: blur(8px);
                border: 1px solid rgba(255, 255, 255, 0.1);
            }
            .particle, .character, .spaceship, .beam, .orb, .nebula, .star, .meteor {
                display: none;
            }
            .text-glow, .neon-glow, .pulse {
                animation: none;
            }
            .neon-glow {
                box-shadow: 0 0 8px rgba(139, 92, 246, 0.4);
            }
            .history-table {
                max-height: 140px;
            }
            h1 {
                font-size: 2.25rem;
            }
            .key-info:hover {
                transform: none;
                box-shadow: none;
            }
            .w-full.max-w-lg {
                padding: 0.75rem;
            }
            .gradient-bg {
                background: linear-gradient(135deg, #f472b6 0%, #f87171 100%);
            }
        }
    </style>
</head>
<body class="min-h-screen flex items-center justify-center p-4 relative">
    <div class="stars"></div>
    <div class="particles"></div>
    <div class="characters"></div>
    <div class="spaceships"></div>
    <div class="beams"></div>
    <div class="orbs"></div>
    <div class="nebulas"></div>
    <div class="meteors"></div>

    <div class="w-full max-w-md z-10">
        <div class="text-center mb-8 slide-in">
            <h1 class="text-5xl font-extrabold bg-gradient-to-r from-purple-500 via-pink-500 to-red-500 bg-clip-text text-transparent tracking-tight text-glow">
                <i class="fas fa-rocket mr-2"></i>KeyGen Nebula
            </h1>
            <p class="text-gray-300 mt-2 text-lg font-light">Secure Keys for Cosmic Navigation</p>
        </div>

        <div id="statusDisplay" class="mb-6 hidden card-bg rounded-xl p-6 neon-glow">
            <p id="statusText" class="text-gray-200 text-center text-base"></p>
            <div id="countdownDisplay" class="countdown text-2xl font-bold text-pink-400 text-center mt-3"></div>
        </div>

        <div id="keyDisplay" class="hidden mb-6 card-bg rounded-xl p-6 neon-glow">
            <h3 class="text-xl font-semibold text-gray-200 mb-4 text-center text-glow">Current Nebula Key</h3>
            <div class="space-y-3">
                <div class="key-info bg-gray-900/50 rounded-lg p-3 flex items-center justify-between">
                    <span class="text-gray-400 text-sm">Key</span>
                    <div class="flex items-center">
                        <code id="generatedKey" class="text-base font-mono text-green-400 break-all mr-2"></code>
                        <button onclick="copyKey()" class="text-purple-400 hover:text-purple-300">
                            <i class="fas fa-copy text-base"></i>
                        </button>
                    </div>
                </div>
                <div class="key-info bg-gray-900/50 rounded-lg p-3 flex justify-between">
                    <span class="text-gray-400 text-sm">Created At</span>
                    <span id="createdAt" class="text-gray-200 text-sm"></span>
                </div>
                <div class="key-info bg-gray-900/50 rounded-lg p-3 flex justify-between">
                    <span class="text-gray-400 text-sm">Expires At</span>
                    <span id="expiresAt" class="text-gray-200 text-sm"></span>
                </div>
                <div class="key-info bg-gray-900/50 rounded-lg p-3 flex justify-between">
                    <span class="text-gray-400 text-sm">Permanent</span>
                    <span id="permanentStatus" class="text-gray-200 text-sm"></span>
                </div>
            </div>
        </div>

        <div id="historyDisplay" class="hidden mb-6 card-bg rounded-xl p-6 neon-glow">
            <h3 class="text-xl font-semibold text-gray-200 mb-4 text-center text-glow">Key Generation History</h3>
            <div class="history-table">
                <table class="w-full text-gray-200 text-xs">
                    <thead>
                        <tr class="bg-gray-900/50">
                            <th class="py-2 px-3 text-left">Key</th>
                            <th class="py-2 px-3 text-left">Created At</th>
                            <th class="py-2 px-3 text-left">Expires At</th>
                            <th class="py-2 px-3 text-left">Permanent</th>
                        </tr>
                    </thead>
                    <tbody id="historyTable"></tbody>
                </table>
            </div>
        </div>

        <div class="space-y-3">
            <button id="getKeyBtn" onclick="getKey()" 
                    class="w-full gradient-bg hover:from-purple-600 hover:to-pink-600 px-6 py-3 rounded-xl font-bold text-base text-white transition-all duration-300 flex items-center justify-center shadow-xl transform hover:scale-105 disabled:opacity-50 disabled:cursor-not-allowed neon-glow pulse hidden">
                <i class="fas fa-rocket mr-2"></i>Launch Nebula Key
            </button>
            <button id="historyBtn" onclick="toggleHistory()" 
                    class="w-full bg-gray-800 hover:bg-gray-700 px-6 py-3 rounded-xl font-bold text-base text-gray-200 transition-all duration-300 flex items-center justify-center shadow-xl transform hover:scale-105 neon-glow">
                <i class="fas fa-history mr-2"></i>View Key History
            </button>
        </div>

        <div class="text-center mt-8 text-gray-400 text-xs font-light">
            <p>Keys expire in 24 hours. 1-hour cooldown between requests.</p>
            <p class="mt-1">Powered by KeyGen Nebula &copy; 2025</p>
        </div>
    </div>
